import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { EffectCube } from "swiper";

import "swiper/css";
import "swiper/css/effect-cube";

export default function Carousel() {
  return (
    <Swiper
      effect={"cube"}
      grabCursor={true}
      cubeEffect={{
        shadow: false,
        slideShadows: true,
        shadowOffset: 20,
        shadowScale: 0.94,
      }}
      pagination={true}
      modules={[EffectCube]}
      className="mySwiper"
    >
      <SwiperSlide>Teacher</SwiperSlide>
      <SwiperSlide>Software Engineer</SwiperSlide>
    </Swiper>
  );
}
